import React from 'react';
import Card from '../../components/UI/Card';
import './style.css';

const Home = props => {
  return (
    <div>
      <Card>
        <section>
          most popular posts
        </section>
        <section>
          less popular posts
        </section>
      </Card>
    </div>
  );
}

export default Home;
